import React from "react";
import "./style.css";
import UserCard from "../UserCard";

function Card(props) {
  console.log(props);
  return (
    <div
      className="card"
      style={{
        backgroundImage: props.results ? `url(${props.results.picture.medium})` : "none"
      }}
    >
      <UserCard results={props.results} />    
    </div>
  );
}

export default Card;
